import './App.css';
import  GetArreyNumber  from './RandomNumber.js'
import Button from './Button.js'
import GetRandomNumber from './RandomNumber.js'

function App() {
  return (<>
    <GetArreyNumber />
    <Button text="Add random number" onMouseEnter={this.GetRandomNumber} />
    </>
  );
}

export default App;
